(712, 169, 'tl_article', 544, 1517829385, 'mateContentBox', 'a:2:{s:4:"unit";s:2:"h4";s:5:"value";s:40:"Sammel-Postkarten in limitierter Auflage";}', '<p>Sehr begehrt und schnell vergriffen, die Sammel-Postkarten im Pin-Up-Look erscheinen unregelm√§√üig mit einer Auflage von 5000 St√ºck und werden in Gesch√§ften der Mei√üner Altstadt verteilt.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:10:"col s12 m6";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', '93', 'Mehr News ansehen', '', '', NULL, 0, '', 0, NULL),
(669, 22, 'tl_news', 32, 1516963450, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Eine Urkunde aus dem Jahr 1161 berichtet, da√ü sich in Mei√üen am Osthang des Meisatales gegen√ºber der Burg, ein schon gut im Ertrag stehender Weinberg befunden hat. Dieser wurde damals von Markgraf Otto dem Reichen an die Kapelle Sankt Egidien √ºbereignet. Diese Urkunde wird heute als Beginn f√ºr den Weinanbau in Sachsen gesehen: somit wird bereits seit √ºber 850 Jahren Wein in Sachsen angebaut.</p>\n<p>Weinanbau gibt es aber in Sachsen sicher schon mindestens ein Jahrtausend: Eine erste Erw√§hnung findet man in der Chronik des Bischofs Thiedmar von Merseburg. Dieser wu√üte zu berichten wu√üte, da√ü Heinrich I. Weinst√∂cke bereits im Jahre 929 (Gr√ºndung der Stadt Mei√üen) im Gau Nisan vorgefunden hatte.</p>\n<p>Im Reich der Sagen angesiedelt ist wohl, dass der Weinanbau auf den Bischof Benno von Mei√üen (ab 1066 im Amt) zur√ºckgeht. Nachvollziehbar ist die Verbindung von Wein und Missionierung der slawischen Urbev√∂lkerung im hiesigen Gebiet zwar, Urkunden dazu lassen sich nicht finden. Gleichwohl ranken sich diverse Legenden und Erz√§hlungen um Benno und den Mei√üner Wein. So soll er an zahlreichen Orten in und um Mei√üen gewirkt haben: er soll z.B. durch einen Schlag mit seinem Krummstab eine Quelle hervorspringen haben lassen.</p>\n<p>M√∂glich auch, dass einfach die hunderttausenden unter anderem fr√§nkischen Siedler, die im Hochmittelalter hierher als freie Bauern zogen, ihre Reben und Weinbautradition mitbrachten.</p>\n<p>Sei es drum: F√ºr die Historiker gilt, dass vor 850 Jahren erstmals in einer Urkunde der Weinbau im Elbtal Erw√§hnung fand. Das Jahr 1161 wird also landauf und landab als Beginn des Weinbaus gefeiert: 2011 wurde gro√ü das Jubil√§um "850 Jahre Weinbau in Sachsen" begangen. So entwickelte die Winzergenossenschaft Mei√üen eine exklusive (aber bereits ausgetrunkene) Reihe "Anno 1161"-Weine - deren Folgejahrg√§nge nat√ºrlich genauso gut schmecken.</p>', '1', 'æØg±ÇËá\0@ç\\"˙A', '', '', 'a:3:{i:0;s:3:"400";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"15";s:4:"left";s:1:"0";s:5:"right";s:2:"15";s:3:"top";s:2:"20";s:4:"unit";s:2:"px";}', '', '', '', 'left', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', '', '', '', '', NULL, 0, '', 0, NULL),
(668, 21, 'tl_news', 32, 1516705812, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Die oft als die ‚ÄúWiege Sachsens‚Äù bezeichnete Stadt Mei√üen liegt etwa 15 km nordwestlich von der Landeshauptstadt Dresden an der M√ºndung von Triebisch und Meisa in die Elbe. 929 wurde die Burg Mei√üen und die Markgrafschaft Mei√üen auf dem Bergsporn √ºber der Elbe gegr√ºndet. Mei√üen geh√∂rt zu den am n√∂rdlichsten gelegenen Weinanbaugebieten in Deutschland und befindet sich mitten im Herzen der S√§chsischen Weinstra√üe. Bekannt wurde die im Jahre 1150 ertmals als ‚Äúcivitas‚Äù bezeichete Stadt durch die erste europ√§ische Porzellanmanufaktur und deren charakteristische ‚ÄúBlauen Schwerter‚Äù.</p>\n<p>Die Geschichte Mei√üens berichtet √ºber ein stetiges Wachstum von Wirtschaft und Kultur, welches aufgrund des 30-j√§hrigen Krieges und den Kriegsjahren im 18. und 19. Jh. unterbrochen wurde. Bauten im gotischen und sp√§tgotischen Stil, sowie B√ºrgerh√§user aus der Renaissancezeit formen die unverwechselbare Kulisse der Mei√üner Altstadt. Viele weitere Sehensw√ºrdigkeiten und Veranstaltungen, wie das Mei√üner Weinfest oder die Mei√üner Weihnacht, in und um Mei√üen runden einen erlebnisreichen und kulturellen Besuch in der Wein- und Porzellanstadt ab.</p>', '', '†ò''øÀ]Áö"@ç\\"˙A', '', '', 'a:3:{i:0;s:3:"200";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"15";s:4:"left";s:1:"0";s:5:"right";s:2:"15";s:3:"top";s:2:"15";s:4:"unit";s:2:"px";}', '', '', '', 'left', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', '', '', '', '', NULL, 0, '', 0, NULL),
