(754, 160, 'tl_article', 640, 1517397789, 'text', 'a:2:{s:4:"unit";s:2:"h4";s:5:"value";s:13:"Albrechtsburg";}', '<p>Die Albrechtsburg ist eines der bekanntesten Schl√∂sser in Deutschland und gilt als erster Schlossbau in Deutschland.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', 'ce_text_simplebox_mate', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 'col s12 m6', '', '', '', '', '', '', NULL, 0, '', 0, NULL),
(755, 160, 'tl_article', 768, 1517397789, 'text', 'a:2:{s:4:"unit";s:2:"h4";s:5:"value";s:19:"Porzellanmanufaktur";}', '<p>International ber√ºhmt ist die Stadt Mei√üen f√ºr die Herstellung des Mei√üner Porzellans, das als erstes europ√§isches Porzellan seit 1708 hergestellt wird.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', 'ce_text_simplebox_mate', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', 'col s12 m6', '', '', '', '', '', '', NULL, 0, '', 0, NULL),
(671, 16, 'tl_news', 128, 1516963314, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>Die √ºber tausendj√§hrige Stadt Mei√üen in der Wiege Sachsens wurde Unterhalb der um das Jahr 929 von K√∂nig Heinrich I. gegr√ºndeten Burg ‚ÄúMisnia‚Äù gegr√ºndet. Mei√üen entwickelte sich von der anf√§nglichen Marktsiedlung Ende des 12. Jahrhunderts zu einer Stadt (Stadtrechte 1332 urkundlich bezeugt). Bis 1423 herschte die Marktgrafschaft Mei√üen, bekannte Markgrafen waren Konrad der Gro√üe, Friedrich der Streitbare Dietrich der Bedr√§ngte, Heinrich der Erlauchte und die Wettiner. Friedrich der Streitbare wurde der Kurf√ºrst von Sachsen.</p>\n<p>Das historische Stadtbild von Mei√üen wird stark gepr√§gt durch den Mei√üner Dom und die Albrechtsburg. Um 1250 wurde mit dem Bau des Doms begonnen, dessen vorgelagerte F√ºrstenkapelle eine der ber√ºhmtesten Begr√§bnisst√§tten der Wettiner ist. Von1470 ‚Äì 1524 wurde unter Arnold von Westfalen die Albrechtsburg errichtet, sie ist der erste Schlossbau im deutschsprachigen Raum und wurde in sp√§tgotischem Stil erbaut.1710 wurde die Porzellan-Manufaktur Mei√üen als staatliche Institution gegr√ºndet.</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', '', '', '', '', NULL, 0, '', 0, NULL),
