(25, 108, 1516967092, '850 Jahre Weinbau in Sachsen', 'https://mate.pdir.de/news-details/items/850-jahre-weinbau-in-sachsen.html', '850 Jahre Weinbau in Sachsen Eine Urkunde aus dem Jahr 1161 berichtet, da√ü sich in Mei√üen am Osthang des Meisatales gegen√ºber der Burg, ein schon gut im Ertrag stehender Weinberg befunden ‚Ä¶ insert_email info@example.com insert_phone 01234 - 1234 567 insert_schedule Montag bis Freitag: 09:00 bis 17:00 Uhr 23.01.2018 10:35 Wissenswertes 850 Jahre Weinbau in Sachsen Eine Urkunde aus dem Jahr 1161 berichtet, da√ü sich in Mei√üen am Osthang des Meisatales gegen√ºber der Burg, ein schon gut im Ertrag stehender Weinberg befunden hat. Dieser wurde damals von Markgraf Otto dem Reichen an die Kapelle Sankt Egidien √ºbereignet. Diese Urkunde wird heute als Beginn f√ºr den Weinanbau in Sachsen gesehen: somit wird bereits seit √ºber 850 Jahren Wein in Sachsen angebaut. Weinanbau gibt es aber in Sachsen sicher schon mindestens ein Jahrtausend: Eine erste Erw√§hnung findet man in der Chronik des Bischofs Thiedmar von Merseburg. Dieser wu√üte zu berichten wu√üte, da√ü Heinrich I. Weinst√∂cke bereits im Jahre 929 (Gr√ºndung der Stadt Mei√üen) im Gau Nisan vorgefunden hatte. Im Reich der Sagen angesiedelt ist wohl, dass der Weinanbau auf den Bischof Benno von Mei√üen (ab 1066 im Amt) zur√ºckgeht. Nachvollziehbar ist die Verbindung von Wein und Missionierung der slawischen Urbev√∂lkerung im hiesigen Gebiet zwar, Urkunden dazu lassen sich nicht finden. Gleichwohl ranken sich diverse Legenden und Erz√§hlungen um Benno und den Mei√üner Wein. So soll er an zahlreichen Orten in und um Mei√üen gewirkt haben: er soll z.B. durch einen Schlag mit seinem Krummstab eine Quelle hervorspringen haben lassen. M√∂glich auch, dass einfach die hunderttausenden unter anderem fr√§nkischen Siedler, die im Hochmittelalter hierher als freie Bauern zogen, ihre Reben und Weinbautradition mitbrachten. Sei es drum: F√ºr die Historiker gilt, dass vor 850 Jahren erstmals in einer Urkunde der Weinbau im Elbtal Erw√§hnung fand. Das Jahr 1161 wird also landauf und landab als Beginn des Weinbaus gefeiert: 2011 wurde gro√ü das Jubil√§um "850 Jahre Weinbau in Sachsen" begangen. So entwickelte die Winzergenossenschaft Mei√üen eine exklusive (aber bereits ausgetrunkene) Reihe "Anno 1161"-Weine - deren Folgejahrg√§nge nat√ºrlich genauso gut schmecken. Musterfirma GmbH Musterstra√üe 12 00000 Musterhausen Tel.: + 49 (0) 1234 56789 Fax: + 49 (0) 1234 56789 Mail: info@example.com Platzhalter Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. arrow_upward ¬© Firma Impressum powered by contao-themes.net', 21.36, '523600b94e3a511b17eeeb32b25a874c', '', 0x30, 'de'),
