(42, 137, 1516983294, 'Do your users have any questions?', 'https://mate.pdir.de/module/faq/faq-details/items/8.html', 'Do your users have any questions? Do your users have any questions? insert_email info@example.com insert_phone 01234 - 1234 567 insert_schedule Montag bis Freitag: 09:00 bis 17:00 Uhr Do your users have any questions? To display the FAQ on your website you can choose from three modules in the Contao back-end. Those offer the possibility to configure the output of your frequently asked questions in various ways. FAQ - List FAQ - Reader FAQ - Page The FAQ - List is a frontend module that lets you list your questions and answers from chosen categories. Only the title question and a link to the FAQ - Reader (which needs to be placed on a secondary site) are displayed. It might be a good option to choose this ouput if you have a longer list of questions. Another way to display information to the visitors is the FAQ - Page module. This module lists all your questions and answers on one page. Linking to another site is not necessary and therefore it is recommanded if you want to show just a few questions and keep all the information on one site. With a little additional code in the mod_faqpage.html5 template you can easily integrate a javascript accordion which will improve the usability of your FAQ greatly for your visitors. Zuletzt aktualisiert am 29.11.2017 von Philipp Seibt. Einen Kommentar schreiben Musterfirma GmbH Musterstra√üe 12 00000 Musterhausen Tel.: + 49 (0) 1234 56789 Fax: + 49 (0) 1234 56789 Mail: info@example.com Platzhalter Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. arrow_upward ¬© Firma Impressum powered by contao-themes.net', 22.68, 'e389e87ca6ece62ede70d92706a4be9e', '', 0x30, 'de'),
